import Home from './pages/Home/Home';
import Content from './pages/Content/Content';
import MyCreatePost from '../src/components/CreatePost';

import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Home />
        <Content />

        <Route path="/post" element={<MyCreatePost />} />
      </Routes>
    </div>
  );
}

export default App;
